import './App.css';
import Header from './components/Header';
import {BrowserRouter as Router, Switch, Route, Link, Redirect} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header />
        <Router>
          <nav className="navbar">
            <Link to="/" style={{textDecoration: "none"}}>The Gym Pod</Link>
            <Link to="/" style={{textDecoration: "none"}}>B</Link>
            <Link to="/" style={{textDecoration: "none"}}>C</Link>
            <Link to="/" style={{textDecoration: "none"}}>D</Link>
            <Link to="/" style={{textDecoration: "none"}}>E</Link>
          </nav>
          <div className="main-app">         
            <Switch>
              <Route></Route>

            </Switch>
          </div>
        </Router>
    </div>
  );
}

export default App;
